import { Config } from "../config";
import { publishPagination } from 'meteor/kurounin:pagination';
import { Accounts } from 'meteor/accounts-base'


Meteor.startup(() => {
  Config._ensureIndex({ name: 1 }, { unique: true });
  Config._ensureIndex({ uuid: 1 }, { unique: true });
  publishPagination(Config);

  const configs = [
    { name: 'itemName', value: 'Item', uuid: Random.id() },
    { name: 'categoryName', value: 'Item Category', uuid: Random.id() },
    { name: 'myList', value: 'myList category', uuid: Random.id() },
    { name: 'userName', value: 'User', uuid: Random.id() },
    { name: 'roleName', value: 'Role', uuid: Random.id() },
    { name: 'zoneName', value: 'Zone', uuid: Random.id() },
    { name: 'attendanceName', value: 'Attendance', uuid: Random.id() },
    { name: 'login', value: 'Login', uuid: Random.id() },
    { name: 'headerName', value: 'FieldNXT Solution', uuid: Random.id() },
    { name: 'appName', value: 'FieldNXT', uuid: Random.id() },
    { name: 'url', value: 'http://fieldnxt.com', uuid: Random.id() },
    { name: 'logo', value: 'data:image/png;base64,', uuid: Random.id() },
    { name: 'sMTPUsername', value: 'vvnath1993@gmail.com', uuid: Random.id() },
    { name: 'sMTPPassword', value: 'visakh143', uuid: Random.id() },
    { name: 'sMTPServer', value: 'smtp.gmail.com', uuid: Random.id() },
    { name: 'sMTPPort', value: '25', uuid: Random.id() },
    { name: 'sendVerificationEmail', value: true, uuid: Random.id() }
    // {name: 'absoluteURL', value: 'http://192.168.35.219:3000', uuid: Random.id()}, 
  ];


  _.each(configs, function (config, index) {
    const existingConfig = Config.findOne({ name: config.name });
    if (!existingConfig) Config.insert(config);
  });

  /**
   * Adding role admin
   * Permission giving
   */
  const roleName = Meteor.roles.findOne({ name: 'Admin' });
  if (!roleName) {
    Meteor.roles.insert({
      name: 'Admin',
      permissions: ['userCreate', 'userUpdate', 'userDelete', 'userView',
        'itemCategoryCreate', 'itemCategoryUpdate', 'itemCategoryView', 'itemCategoryDelete',
        'roleView', 'roleCreate', 'roleUpdate', 'roleDelete', 'attendanceView', 'attendanceCreate',
        'zoneView', 'zoneCreate', 'zoneUpdate', 'zoneDelete'
      ],
      isDeleted: false,
      createdAt: new Date(),
      createdBy: 'Admin',
      uuid: Random.id()
    });
  }

  /**
  * Creating Admin in startup
  */
  const existing = Meteor.users.findOne({ username: 'admin' });
  if (!existing) {
    const userId = Accounts.createUser({
      profile: {
        firstName: 'Admin', lastName: 'FieldNXT',
        gender: 'Male', dateOfBirth: ' 01/01/2018', isDeleted: false
      },
      email: 'admin@fieldnxt.com',
      image: '',
      username: 'admin',
      password: 'Admin@143@',
      createdAt: new Date(),
      createdBy: 'admin'
    });
    // return userId;
    if (userId) {
      const token = Accounts._generateStampedLoginToken().token;
      let role = Meteor.roles.findOne({ name: "Admin" });
      // Roles.setUserRole(userId,role._id);
      return Meteor.users.update(userId, { $set: { token: token, "emails.0.verified": true, roles: [role._id] } });
    };
  }
  /**
   * TODO: Complete JS doc
   */
  const sendVerificationEmail = Config.findOne({ name: 'sendVerificationEmail' });
  Accounts.config({ sendVerificationEmail: sendVerificationEmail.value });

  /**
   * TODO: Complete JS doc
  * Absolute Url setup
  */
  // Meteor.absoluteUrl.defaultOptions.rootUrl = Config.findOne({name: 'absoluteURL'}).value;

  /**
   * TODO: Complete JS doc
   */
  const sMTPUsername = Config.findOne({ name: 'sMTPUsername' });
  const sMTPPassword = Config.findOne({ name: 'sMTPPassword' });
  const sMTPServer = Config.findOne({ name: 'sMTPServer' });
  const sMTPPort = Config.findOne({ name: 'sMTPPort' });

  return process.env.MAIL_URL = 'smtp://' + encodeURIComponent(sMTPUsername.value) + ':' + encodeURIComponent(sMTPPassword.value) + '@' + encodeURIComponent(sMTPServer.value) + ':' + sMTPPort.value;

});

/**
 * TODO: Complete JS doc
 */
Meteor.publish('config.list', function () {
  return Config.find({}, { sort: { name: 1 } });
});


/**
 * TODO: Complete JS doc
 * @param currentUserId
 * @param imageData
 */
Meteor.methods({
  'user.profileImage.update': (currentUserId, imageData) => {
    return Meteor.users.update({ _id: currentUserId }, {
      $set:
      {
        profile:
        {
          image: imageData,
          firstName: Meteor.user().profile.firstName,
          lastName: Meteor.user().profile.lastName,
          gender: Meteor.user().profile.gender,
          dateOfBirth: Meteor.user().profile.dateOfBirth,
          isDeleted: false
        }
      }
    });
  }
});
